<script type="text/javascript">
  function openNav() {
    document.getElementById("sidebar").classList.remove("hidden");
    document.getElementById("sidebar-button").onclick = closeNav;
  }

  function closeNav() {
    document.getElementById("sidebar").classList.add("hidden");
    document.getElementById("sidebar-button").onclick = openNav;
  }

  var modal = document.getElementById("pn-Modal");
  var span = document.getElementById("pn-closeModal");

  span.onclick = function() {
    modal.style.display = "none";
  }

  window.onclick = function(event) {
    if (event.target == modal) {
      modal.style.display = "none";
    }
  }
</script>

<script type="text/babel">
  const ResponsiveGridLayout = ReactGridLayout.WidthProvider(ReactGridLayout.Responsive);
  const originalLayout = getFromLS("layouts") || {"lg": [{"x": 0, "y": -5, "w": 12, "h": 5, "i": "1", "minW": 0, "minH": 0}, {"x": 0, "y": 0, "w": 6, "h": 11, "i": "2", "minW": 0, "minH": 0}, {"x": 6, "y": 0, "w": 6, "h": 11, "i": "3", "minW": 0, "minH": 0}], "md": [{"x": 0, "y": -5, "w": 12, "h": 5, "i": "1", "minW": 0, "minH": 0}, {"x": 0, "y": 0, "w": 6, "h": 11, "i": "2", "minW": 0, "minH": 0}, {"x": 6, "y": 0, "w": 6, "h": 11, "i": "3", "minW": 0, "minH": 0}]};

  function resize_layout(obj, old_, new_, p, e, element) {
    window.dispatchEvent(new Event("resize"))
  }

  function resize_layout_stop(obj, old_, new_, p, e, element) {
    setTimeout(function(){
      window.dispatchEvent(new Event("resize"))
    }, 50);
  }

  function getFromLS(key) {
    let ls = {};
    if (window.localStorage) {
      try {
        ls = JSON.parse(window.localStorage.getItem(window.location.origin + window.location.pathname)) || {};
      } catch (e) {
        /*Ignore*/
      }
    }
    return ls[key];
  }

  function saveToLS(key, value) {
    if (window.localStorage) {
      window.localStorage.setItem(
        window.location.origin + window.location.pathname,
        JSON.stringify({
          [key]: value
        })
      );
    }
  }

  class ResponsiveGrid extends React.PureComponent {

    static defaultProps = {
      onLayoutChange: function() {}
    }

    constructor(props) {
      super(props);
      this.state = {
	layouts: JSON.parse(JSON.stringify(originalLayout))
      };
      this.resetLayout = this.resetLayout.bind(this)
      document.getElementById('layout-reset').onclick = this.resetLayout
      this.mounted = false;
    }

    resetLayout() {
      this.setState({
        layouts: {"lg": [{"x": 0, "y": -5, "w": 12, "h": 5, "i": "1", "minW": 0, "minH": 0}, {"x": 0, "y": 0, "w": 6, "h": 11, "i": "2", "minW": 0, "minH": 0}, {"x": 6, "y": 0, "w": 6, "h": 11, "i": "3", "minW": 0, "minH": 0}], "md": [{"x": 0, "y": -5, "w": 12, "h": 5, "i": "1", "minW": 0, "minH": 0}, {"x": 0, "y": 0, "w": 6, "h": 11, "i": "2", "minW": 0, "minH": 0}, {"x": 6, "y": 0, "w": 6, "h": 11, "i": "3", "minW": 0, "minH": 0}]}
      });
    }

    onLayoutChange(layout, layouts) {
      saveToLS("layouts", layouts);
      this.setState({ layouts });
    }

    componentDidMount() {
    }

    render() {
      return (
        <ResponsiveGridLayout
           className={"layout"}
           cols={ {'lg': 12, 'md': 10, 'sm': 6, 'xs': 4, 'xxs': 2} }
           breakpoints={ {'lg': 1200, 'md': 996, 'sm': 768, 'xs': 480, 'xxs': 0} }
	   onResize={resize_layout}
           onResizeStop={resize_layout_stop}
           draggableHandle={".drag-handle"}
           draggableCancel={".bk-root"}
           rowHeight={ 30 }
           layouts={this.state.layouts}
           verticalCompact={false}
           preventCollision={ false }
           onLayoutChange={(layout, layouts) => this.onLayoutChange(layout, layouts)}
         >
            <div className="card-margin" key="1" style={{borderRadius: '5px'}}>
              <fast-card class="pn-wrapper">
                <span className="drag-handle"></span>
                <span className="fullscreen-button">
                  <svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" viewBox="0 0 18 18">
                    <path d="M4.5 11H3v4h4v-1.5H4.5V11zM3 7h1.5V4.5H7V3H3v4zm10.5 6.5H11V15h4v-4h-1.5v2.5zM11 3v1.5h2.5V7H15V3h-4z"/>
                  </svg>
                </span>
                <div id="f8c1ac89-bb5b-4e6f-8e87-bf5684655723" data-root-id="3910fe63-a562-4a79-831e-b7ecc46fbfe1" style={{display: "contents"}}></div>
             </fast-card>
            </div>
            <div className="card-margin" key="2" style={{borderRadius: '5px'}}>
              <fast-card class="pn-wrapper">
                <span className="drag-handle"></span>
                <span className="fullscreen-button">
                  <svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" viewBox="0 0 18 18">
                    <path d="M4.5 11H3v4h4v-1.5H4.5V11zM3 7h1.5V4.5H7V3H3v4zm10.5 6.5H11V15h4v-4h-1.5v2.5zM11 3v1.5h2.5V7H15V3h-4z"/>
                  </svg>
                </span>
                <div id="e7df7ca1-827d-4184-963f-73866eab5181" data-root-id="809d2134-8ad6-4f13-a9c5-ac6774da5376" style={{display: "contents"}}></div>
             </fast-card>
            </div>
            <div className="card-margin" key="3" style={{borderRadius: '5px'}}>
              <fast-card class="pn-wrapper">
                <span className="drag-handle"></span>
                <span className="fullscreen-button">
                  <svg xmlns="http://www.w3.org/2000/svg" fill="currentColor" viewBox="0 0 18 18">
                    <path d="M4.5 11H3v4h4v-1.5H4.5V11zM3 7h1.5V4.5H7V3H3v4zm10.5 6.5H11V15h4v-4h-1.5v2.5zM11 3v1.5h2.5V7H15V3h-4z"/>
                  </svg>
                </span>
                <div id="ea7314c8-82fe-4d1f-85bf-3b5c4b7f5cf6" data-root-id="f49ad2cc-676a-4604-baa5-7602155c2538" style={{display: "contents"}}></div>
             </fast-card>
            </div>
        </ResponsiveGridLayout>
      );
    }
  }
  ReactDOM.render(<ResponsiveGrid />, document.getElementById('responsive-grid'));
  addFullScreenToggle()
</script>
